import toSRT from './parsing/srt';
import PipelineApiClient from './api/pipeline';
import { ApiClientParams } from './api/client';
import Logger from './logging';
import ClusteringApiClient from './api/clustering';

class OneAI {
/**
 * A Language Skill is a package of trained NLP models.
 * Skills accept text and respond with processed texts and extracted metadata.
 *
 * Process texts with Skills using `Pipeline`s
 */
  readonly skills = skills;

  static skills = skills;

  private pipelineApiClient: PipelineApiClient;

  private clusteringApiClient: ClusteringApiClient;

  logger: Logger;

  static defaultParams: ApiClientParams = {
    apiKey: '',
    timeout: 60,
    baseURL: 'https://api.oneai.com',
  };

  params: ApiClientParams;

  constructor(
    apiKey?: string,
    params?: Partial<ApiClientParams>,
  ) {
    this.params = {
      ...OneAI.defaultParams,
      ...params !== undefined && params,
      ...apiKey !== undefined && { apiKey },
    };

    this.logger = new Logger();
    this.pipelineApiClient = new PipelineApiClient(this.params, this.logger);
    this.Pipeline = createPipelineClass(this.pipelineApiClient);

    this.clusteringApiClient = new ClusteringApiClient(this.params, this.logger);
    const Collection = createCollectionClass(this.clusteringApiClient);
    this.clustering = {
      Item,
      Phrase,
      Cluster,
      Collection,
      getCollections: Collection.getCollections,
    };
  }

  Pipeline;

  clustering;

  parsing: {
    parseConversation: (input: string) => ConversationContent,
    toSRT: (
      output: Output,
      params?: {
        maxLengthWords?: number,
        maxLengthCharacters?: number,
      },
    ) => string,
  } = {
      parseConversation,
      toSRT,
    };

  static OneAI = OneAI;

  public toString(): string {
    const apiKeyString = (this.params.apiKey?.length >= 8) ? this.params.apiKey.substring(0, 8) + '*'.repeat(this.params.apiKey.length - 8) : undefined;
    return `One AI Client - API Key ${apiKeyString}`;
  }
}
export = OneAI;

import fs from 'fs';
import { ApiReqParams } from './api/client';
import PipelineApiClient from './api/pipeline';
import {
  AsyncApiTask,
  Input, Output, Skill, TextContent, wrapContent,
} from './classes';
import { batchProcessing, BatchResponse, polling } from './schedule';

abstract class _Pipeline {
  abstract client: PipelineApiClient;

  steps: Skill[];

  constructor(...steps: Skill[]) {
    this.steps = steps;
  }

  async run(
    text: TextContent | Input,
    params?: ApiReqParams,
  ): Promise<Output> {
    return this.client.postPipeline(
      wrapContent(text),
      this.steps,
      params,
    );
  }

  async runFile(
    filePath: string,
    params?: ApiReqParams & {
      sync?: boolean,
      interval?: number,
    },
  ): Promise<Output> {
    const input = wrapContent({ filePath, buffer: fs.readFileSync(filePath) });
    if (params?.sync) return this.run(input, params);

    // todo: extend to non-file inputs
    this.client.logger.debug(`Uploading file ${input.text.filePath}`);
    const task = await this.client.postAsyncFile(input, this.steps, params);
    this.client.logger.debugNoNewline(`Upload of file ${input.text.filePath} complete\n`);
    return polling(
      task,
      (t: AsyncApiTask) => this.client.getTaskStatus.call(this.client, t),
      params?.interval || 1,
      this.client.logger,
    );
  }

  async runBatch<T extends TextContent | Input>(
    inputs: Iterable<T>,
    params?: ApiReqParams & {
      maxConcurrentRequests?: number,
      onOutput?: (input: T, output: Output) => void,
      onError?: (input: T, error: any) => void,
    },
  ): Promise<BatchResponse<T, Output>> {
    return batchProcessing(
      inputs,
      (input: T) => this.run(input, params),
      params?.maxConcurrentRequests || 2,
      params?.onOutput,
      params?.onError,
      this.client.logger,
    );
  }
}

const createPipelineClass = (client: PipelineApiClient) => class extends _Pipeline {
  client = client;
};

export default createPipelineClass;

import * as path from 'path';
