export function comp4Test(a, b) {
  if ((a == null) !== (b == null)) return false;
  if (a == null) return b == null;
  return a.speaker == b.speaker
    && a.hasText == b.hasText
    && a.separator == b.separator
    && a.preTime == b.preTime
    && a.text == b.text
    && a.weak == b.weak
